import React from 'react';
import './Header.scss';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

const Header = () => {
  return (
    <>
    <Navbar bg="main-navbar" expand="lg">
      <Container>
        <Navbar.Brand href="#home" className='color-scss text-white' >
          <img src="" alt="" className='' />
          React-Bootstrap</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav"  />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="ms-auto text-white">
            <Nav.Link href="#home" className='text-white'>Home</Nav.Link>
            <Nav.Link href="#home" className='text-white'>About</Nav.Link>
            <Nav.Link href="#home" className='text-white'>Service</Nav.Link>
            <Nav.Link href="#link" className='text-white'><Contact></Contact></Nav.Link>
            <NavDropdown title="Dropdown" id="basic-nav-dropdown nav-links">
              <NavDropdown.Item  href="#action/3.1">Action</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.2">
                Another action
              </NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
              {/* <NavDropdown.Divider /> */}
              {/* <NavDropdown.Item href="#action/3.4">
                Separated link
              </NavDropdown.Item> */}
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
    </>
  )
}

export default Header;
